import React from 'react';

const estiloCaixa = {
  border: '1px solid black',
  padding: '10px',
  margin: '10px 0',
  backgroundColor: 'lightgray',
};

const UsuarioSaida = (props) => {
  return (
    <div>
      <div style={estiloCaixa}>
        <p>{props.username}</p>
        <p>Esse é o trabalho 3</p>
      </div>
      <div style={estiloCaixa}>
        <p>{props.typedUsername}</p>
        <p>Esse é o trabalho 3</p>
      </div>
    </div>
  );
};

export default UsuarioSaida;
